import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Start from './components/Start';
import Tlogin from './components/Start';
import Slogin from './components/Start';
//import LoginDiv from './components/Logindiv';
import * as serviceWorker from './serviceWorker';

class Main extends React.Component {
    constructor() {
        super();
        this.handleInputFunction = this.handleInputFunction.bind(this);
      }
      state = {
        name: '',
        activeMenu: "Start",
      };
      handleInputFunction(e) {
        e.preventDefault();
        this.setState({ activeMenu: e.target.value });
      }
      /*render() {
        return (
          <div>
            <h1>Hello, {this.state.name}</h1>
            <Start ourInputFunction={this.handleInputFunction} />
          </div>
        );
      }*/

        
    renderSection = () => {
        switch (this.state.activeMenu) {
            case "Start":
                return <Start ourInputFunction={this.handleInputFunction} />
            case "Slogin":
                return <Slogin/>
            case "Tlogin":
                return <Tlogin/>
            default:
                return <div></div>;
        }
    }
    changeSection = (newSection) => {
        this.setState({ activeMenu: newSection });
    }

    render() {
        return (
            <main >
                <section>
                    {this.renderSection()}
                </section>
            </main>

        );
    }


