            default:
                return <div></div>;
        }
    }
    changeSection = (newSection) => {
        this.setState({ activeMenu: newSection });
    }

    render() {
        return (
            <main >
                <section>
                    {this.renderSection()}
                </section>
            </main>

        );
    }*/
}
ReactDOM.render(<Main />, document.getElementById('react-section'));

